var SecondIndex = function SecondIndex() {
  return import('./orderLogisticInfo.vue');
};

import { getOrderLogisticListAPI, delorderLogisticAPI } from '@/api/prodOrderLogisticAPI.js';
export default {
  name: 'prodList',
  data: function data() {
    return {
      logisticStatelist: {
        0: "运输中",
        1: "已签收"
      },
      form: {
        current: 1,
        size: 10
      },
      tableData: [],
      totalCount: 0,
      tableLoading: false,
      isEdit: false,
      //是否编辑
      updateId: 0,
      //科室ID
      secondDepShow: false,
      //产品1弹窗
      contactName: '',
      contactPhone: '',
      contactAddress: ''
    };
  },
  props: {
    orderId: {
      required: true
    }
  },
  components: {
    // AddDepModal,
    SecondIndex: SecondIndex
  },
  methods: {
    /*
     * 获取物流列表
     */
    getList: function getList() {
      var _this = this;

      var params = {
        orderId: this.orderId
      }; // if(this.value1[0]!=''&&this.value1[0]!=undefined&&this.value1[0]!=null){
      //     params.endTime=timeStamp2String(this.value1[1],2)
      //     params.startTime=timeStamp2String(this.value1[0],2)
      // }

      this.tableLoading = true; //console.log(params);

      getOrderLogisticListAPI(params).then(function (res) {
        console.log(res);
        var data = res.data.data;

        for (var i = 0; i < data.length; i++) {
          if (data[i].logisticTrace == null || data[i].logisticTrace == '') continue;
          var obj_trace = JSON.parse(data[i].logisticTrace); // console.log("物流obj_trace");
          // console.log(obj_trace);
          // console.log(obj_trace.Traces);

          data[i].logisticTraceList = obj_trace.Traces;
        }

        _this.totalCount = data.total;
        _this.tableData = data;
        _this.tableLoading = false;
        console.log(_this.tableData);
      }).catch(function (err) {
        _this.tableLoading = false;
      });
    },
    handleDel: function handleDel(id) {
      var _this2 = this;

      console.log(id);
      this.$confirm('确定要删除该数据么？（此操作不可逆）', '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function () {
        var params = {
          pids: id
        };
        delorderLogisticAPI(params).then(function (res) {
          if (res.data.code === 200) {
            _this2.$message({
              type: 'success',
              message: '删除成功'
            });

            _this2.getList();
          } else {
            _this2.$message.error(res.data.msg);
          }
        }).catch(function (err) {});
      });
    },

    /**
     * @msg: 翻页
     * @param {type} 
     * @return: 
     */
    handleSizeChange: function handleSizeChange(cSize) {
      this.form.size = cSize;
      this.getList();
    },
    handleCurrentChange: function handleCurrentChange(currentPage) {
      this.form.current = currentPage;
      this.getList();
    },

    /**
     * @msg: 新增
     * @param {type} 
     * @return: 
     */
    handleAdd: function handleAdd() {
      this.updateId = 0;
      this.isEdit = false;
      this.secondDepShow = true;
    },

    /**
     * @msg: 修改
     * @param {Number} row  修改产品的信息
     */
    handleUpdate: function handleUpdate(id) {
      this.updateId = id;
      this.secondDepShow = true;
      this.isEdit = true;
    }
  },
  created: function created() {
    console.log("created: " + this.orderId);
    this.getList();
  }
};
